import React from "react";
import "./nav.css";
import { Link } from 'react-router-dom';

function Navegation(props) {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark">
        <img className="logo" src="logo.png" alt="Logo of the store"/>
        <button className="navbar-toggler" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav ml-auto">
                    {/* <a href="#" class="btn btn-primary btn-lg active" role="button">Primary link</a> */}
                <li className="nav-item">
                    {/* <a href="#home" classÃ·Name="btn btn-success" role="button">Home</a> */}
                    <Link to="/" className="btn btn-success">Home</Link>
                </li>
                <li className="nav-item active">
                    {/* <a href="#product" className="btn btn-primary" role="button">Products</a> */}
                    <Link to="/products" className="btn btn-success">Products</Link>
                </li>
            <li className="nav-item">
            {/* <a href="#contact" className="btn btn-info" role="button">Contact</a> */}
            <Link to="/contact" className="btn btn-success">Contact</Link>
            </li>
        </ul>

            <form onSubmit={event => event.preventDefault()} className="form-inline my-2 my-lg-0 search-bar">
                <input className="input-space" type="text" onChange={event => props.filtering(event)} placeholder="Search for names.." title="Type in a name"/>
                <select onChange={e => props.dropboxChange(e)}>
                    <option value="processor">processor</option>
                    <option value="watch">watch</option>
                    <option value="play console">play console</option>
                    <option value="3">3</option>
                    <option value="4">4</option>
                </select>
                <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
            </form>
        </div>
        </nav> 

    );
    }

export default Navegation;
